INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106001, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, 7001, 1, 7, "キャル", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105901, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, 7002, 1, 7, "コッコロ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105801, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, 7003, 1, 7, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105801, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, 10001, 1, 10, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106001, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, 10002, 1, 10, "キャル", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105901, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, 10003, 1, 10, "コッコロ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106401, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 1, 10004, 1, 10, "シェフィ", 2104010, "2030/12/17 14:59:59", 2, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105801, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, 12001, 1, 12, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, -416.5, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106001, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, 13001, 1, 13, "キャル", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105901, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, 13002, 1, 13, "コッコロ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106401, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 1, 13003, 1, 13, "シェフィ", 2104010, "2030/12/17 14:59:59", 2, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105801, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, 13004, 1, 13, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105901, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, 14001, 1, 14, "コッコロ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106401, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 1, 14002, 1, 14, "シェフィ", 2104010, "2030/12/17 14:59:59", 2, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105801, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, 14003, 1, 14, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106001, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, 14004, 1, 14, "キャル", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105901, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, 15001, 1, 15, "コッコロ", 0, "2030/12/17 14:59:59", 1, -470.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106401, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 1, 16001, 1, 16, "シェフィ", 2104010, "2030/12/17 14:59:59", 2, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105801, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, 16002, 1, 16, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106001, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 1, 16003, 1, 16, "キャル", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105901, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 1, 16004, 1, 16, "コッコロ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105901, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 1, 17002, 1, 17, "コッコロ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106001, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 1, 17004, 1, 25, "キャル", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105901, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 1, 17005, 1, 25, "コッコロ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106401, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 1, 17006, 1, 25, "シェフィ", 2104010, "2030/12/17 14:59:59", 2, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105801, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 1, 17007, 1, 25, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 1, 18001, 1, 18, "カリン", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 1, 18002, 2, 18, "カリン", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 1, 19001, 3, 19, "カリン", 0, "2030/12/17 14:59:59", 1, -470.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 1, 19002, 4, 19, "カリン", 0, "2030/12/17 14:59:59", 1, -470.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 1, 20001, 5, 20, "カリン", 0, "2030/12/17 14:59:59", 1, -470.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 1, 20002, 6, 20, "カリン", 0, "2030/12/17 14:59:59", 1, -470.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106001, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 1, 21001, 1, 21, "キャル", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105901, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 1, 21002, 1, 21, "コッコロ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106401, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 1, 21003, 1, 21, "シェフィ", 2104010, "2030/12/17 14:59:59", 2, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105801, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, 21004, 1, 21, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, 22001, 1, 22, "カリン", 0, "2030/12/17 14:59:59", 1, -430.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 1, 22002, 2, 22, "カリン", 0, "2030/12/17 14:59:59", 1, -430.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 1, 23001, 3, 23, "カリン", 0, "2030/12/17 14:59:59", 1, -430.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 1, 23002, 4, 23, "カリン", 0, "2030/12/17 14:59:59", 1, -430.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10011, 109001, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 2, 24001, 1, 24, "エリコ（バレンタイン）", 0, "2030/12/17 14:59:59", 1, -385.0, 8.0, 4.08, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10011, 109001, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 2, 24002, 2, 24, "エリコ（バレンタイン）", 0, "2030/12/17 14:59:59", 1, -385.0, 8.0, 5.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10011, 109001, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 2, 24003, 3, 24, "エリコ（バレンタイン）", 0, "2030/12/17 14:59:59", 1, -385.0, 8.0, 10.11, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10011, 109001, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 2, 24004, 4, 24, "エリコ（バレンタイン）", 0, "2030/12/17 14:59:59", 1, -385.0, 8.0, 4.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10011, 109001, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 2, 24005, 5, 24, "エリコ（バレンタイン）", 0, "2030/12/17 14:59:59", 1, -385.0, 8.0, 6.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10011, 109002, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 1, 24006, 6, 24, "エリコ（バレンタイン）", 0, "2030/12/17 14:59:59", 1, 0.0, 0.0, 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10011, 109002, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 1, 24007, 7, 24, "エリコ（バレンタイン）", 0, "2030/12/17 14:59:59", 1, 0.0, 0.0, 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10011, 109002, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 1, 24008, 8, 24, "エリコ（バレンタイン）", 0, "2030/12/17 14:59:59", 1, 0.0, 0.0, 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10011, 109002, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 1, 24009, 9, 24, "エリコ（バレンタイン）", 0, "2030/12/17 14:59:59", 1, 0.0, 0.0, 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10011, 109002, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 1, 24010, 10, 24, "エリコ（バレンタイン）", 0, "2030/12/17 14:59:59", 1, 0.0, 0.0, 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10011, 109101, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 2, 24011, 1, 24, "シズル（バレンタイン）", 0, "2030/12/17 14:59:59", 1, -385.0, 8.0, 2.12, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10011, 109101, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 2, 24012, 2, 24, "シズル（バレンタイン）", 0, "2030/12/17 14:59:59", 5, -385.0, 8.0, 4.19, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10011, 109101, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 4, 24013, 3, 24, "シズル（バレンタイン）", 0, "2030/12/17 14:59:59", 2, -385.0, 8.0, 2.3, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10011, 109102, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 1, 24014, 4, 24, "シズル（バレンタイン）", 0, "2030/12/17 14:59:59", 1, 0.0, 0.0, 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10011, 109101, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 2, 24015, 5, 24, "シズル（バレンタイン）", 0, "2030/12/17 14:59:59", 5, -385.0, 8.0, 5.23, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10011, 109102, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 1, 24016, 6, 24, "シズル（バレンタイン）", 0, "2030/12/17 14:59:59", 1, 0.0, 0.0, 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10011, 109101, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 2, 24017, 7, 24, "シズル（バレンタイン）", 0, "2030/12/17 14:59:59", 1, -385.0, 8.0, 5.01, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10011, 109102, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 1, 24018, 8, 24, "シズル（バレンタイン）", 0, "2030/12/17 14:59:59", 1, 0.0, 0.0, 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10011, 109102, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 1, 24019, 9, 24, "シズル（バレンタイン）", 0, "2030/12/17 14:59:59", 1, 0.0, 0.0, 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (10011, 109102, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 1, 24020, 10, 24, "シズル（バレンタイン）", 0, "2030/12/17 14:59:59", 1, 0.0, 0.0, 0.0, "2019/01/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106401, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 1, 26001, 1, 26, "シェフィ", 2104010, "2030/12/17 14:59:59", 2, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105801, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 1, 26002, 1, 26, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106001, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", 1, 26003, 1, 26, "キャル", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105901, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", 1, 26004, 1, 26, "コッコロ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106401, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 1, 27001, 1, 27, "シェフィ", 2104010, "2030/12/17 14:59:59", 2, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105801, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 1, 27002, 1, 27, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106001, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 1, 27003, 1, 27, "キャル", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105901, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", 1, 27004, 1, 27, "コッコロ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", 1, 28001, 1, 28, "カリン", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2019/09/24 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください", 1, 28002, 2, 28, "カリン", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2019/09/24 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", 1, 29001, 3, 29, "カリン", 0, "2030/12/17 14:59:59", 1, -409.0, 0.0, 0.0, "2019/09/24 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ", 1, 29002, 4, 29, "カリン", 0, "2030/12/17 14:59:59", 1, -409.0, 0.0, 0.0, "2019/09/24 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！", 1, 30001, 5, 30, "カリン", 0, "2030/12/17 14:59:59", 1, -409.0, 0.0, 0.0, "2019/09/24 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！", 1, 30002, 6, 30, "カリン", 0, "2030/12/17 14:59:59", 1, -409.0, 0.0, 0.0, "2019/09/24 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", 1, 31001, 7, 31, "カリン", 0, "2030/12/17 14:59:59", 1, -409.0, 0.0, 0.0, "2019/10/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", 1, 31002, 8, 31, "カリン", 0, "2030/12/17 14:59:59", 1, -409.0, 0.0, 0.0, "2019/10/31 12:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", 1, 32001, 1, 32, "カリン", 0, "2020/01/04 4:59:59", 1, -409.0, 0.0, 0.0, "2019/12/20 5:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 1, 32002, 2, 32, "カリン", 0, "2020/01/04 4:59:59", 1, -409.0, 0.0, 0.0, "2019/12/20 5:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", 1, 33001, 3, 33, "カリン", 0, "2020/01/04 4:59:59", 1, -409.0, 0.0, 0.0, "2019/12/20 5:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", 1, 33002, 4, 33, "カリン", 0, "2020/01/04 4:59:59", 1, -409.0, 0.0, 0.0, "2019/12/20 5:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", 1, 34001, 5, 34, "カリン", 0, "2020/01/10 11:59:59", 1, -409.0, 0.0, 0.0, "2020/01/04 5:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", 1, 34002, 6, 34, "カリン", 0, "2020/01/10 11:59:59", 1, -409.0, 0.0, 0.0, "2020/01/04 5:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105801, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", 2, 38001, 1, 38, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, -458.0, 0.0, 5.3, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105801, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", 2, 38002, 2, 38, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, -458.0, 0.0, 6.5, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105801, "", 3, 39005, 0, 39, "ペコリーヌ", 0, "2020/04/08 23:59:59", 3, 9999.0, 9999.0, 0.0, "2020/04/01");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 190801, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", 1, 40001, 2, 40, "カリン", 0, "2030/12/17 14:59:59", 1, -430.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106401, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", 1, 41001, 1, 41, "シェフィ", 2104010, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105801, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", 1, 41002, 1, 41, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106001, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", 1, 41003, 1, 41, "キャル", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105901, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", 1, 41004, 1, 41, "コッコロ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105901, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", 1, 42001, 1, 42, "コッコロ", 0, "2030/12/17 14:59:59", 1, -416.5, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106401, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", 1, 42002, 1, 42, "シェフィ", 2104010, "2030/12/17 14:59:59", 1, -416.5, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105801, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", 1, 42003, 1, 42, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, -416.5, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106001, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", 1, 42004, 1, 42, "キャル", 0, "2030/12/17 14:59:59", 1, -416.5, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105801, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", 1, 43001, 1, 43, "ペコリーヌ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 105901, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 1, 43002, 1, 43, "コッコロ", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 106001, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 1, 43003, 1, 43, "キャル", 0, "2030/12/17 14:59:59", 1, -363.0, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 123001, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 1, 43004, 1, 44, "アメス", 0, "2030/12/17 14:59:59", 1, -416.5, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 123001, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 1, 43005, 2, 44, "アメス", 0, "2030/12/17 14:59:59", 1, -416.5, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 123001, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 2, 43006, 3, 45, "アメス", 0, "2030/12/17 14:59:59", 1, -416.5, 0.0, 5.79, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 123001, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 1, 46001, 1, 46, "アメス", 0, "2030/12/17 14:59:59", 1, -371.5, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 104901, "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 2, 47001, 1, 47, "シズル", 0, "2030/12/17 14:59:59", 2, -416.5, 0.0, 0.0, "2015/12/17 15:00:00");
INSERT INTO `v1_776e3322fd12e3c9a6d5e9ddf469674870015db93a49179d559afb43a36745ef` VALUES (0, 101101, "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", 2, 47002, 1, 47, "リノ", 0, "2030/12/17 14:59:59", 1, -416.5, 0.0, 9.32, "2015/12/17 15:00:00");
